import React from 'react';
import{
  Container,
  Breadcrumb,
  Row,
  Col,
  Dropdown
} from "react-bootstrap";

function App() {
  return (
    <Container>
      <Row>
        <Col>
          <Dropdown>
            <Dropdown.Toggle variant="primary">
            <h6>Pilih Bahasa</h6>
            </Dropdown.Toggle>
          </Dropdown>
        </Col>
        <Col></Col>
        <Col></Col>
      </Row>
    </Container>
  );
}

export default App;
